actionConfiguration.body:
(matches) => {
		const winrate = (_.filter(matches, utils.isWin).length / 20 * 100).toFixed(2) + '%'
		const kills = utils.averMaxKda(matches, 'kills')
		const mostKillsMatch = _.maxBy(matches, 'kills')
		const deaths = utils.averMaxKda(matches, 'deaths')
		const mostDeathsMatch = _.maxBy(matches, 'deaths')
		const assists = utils.averMaxKda(matches, 'assists')
		const mostAssistsMatch = _.maxBy(matches, 'assists')
		return {
			winrate,
			kills,
			deaths,
			assists,
			mostKills: mostKillsMatch.kills,
			mostKillsHeroId: mostKillsMatch.hero_id,
			mostDeaths: mostDeathsMatch.deaths,
			mostDeathsHeroId: mostDeathsMatch.hero_id,
			mostAssists: mostAssistsMatch.assists,
			mostAssistsHeroId: mostAssistsMatch.hero_id
		}
	}

